import React from "react";

export default function Dictionary() {
  function search(event) {
    event.preventDefault();
  }

  return (
    <div class="dictionaryContainer">
      <form>
        <input type="search" placeholder="Type a word" autofocus="on" />
      </form>
    </div>
  );
}
